Deep River.QN:
1.  "“Shall the Town of Deep River establish a Municipal Ethics Commission by passage of the following Ordinance? Yes or No?:
1.	Be it enacted by the electors of the Town of Deep River that
2.	There shall be an Ethics Commission which shall consist of five members and two alternate members. The members shall be elected on the Municipal election day by majority vote and serve four-year terms beginning December 1, except that the initial election shall be held by paper ballot at a Town meeting within 60 days of adoption of the ordinance. The terms of the Commission shall be staggered so that all do not expire at the same time. No individual shall serve for more than 12 consecutive years. No more than three shall be members of the same political party.
3.	All members of the Commission shall be electors of the municipality. No member of the Commission shall:
a.	Hold or campaign for any public office during their term;
b.	Hold office in any political party or political committee;
c.	Concurrently serve as a member of any other agency, committee or commission of the municipality;
d.	Be a public official or employee of the municipality or an official or employee of a quasi-public agency of the municipality;
e.	Be an immediate family member of a sitting member of the Ethics Commission
f.	Be a party to any contract doing business with the Town of Deep River; or
g.	Have held elected office on the Board of Selectmen, Board of Education, Registrar of Voters, Judge of Probate, Board of Library Trustees or Constable in a three-year period prior to appointment.
4.	Political activity:
a.	Although any member or employee of the Commission shall have an unrestricted right to vote, make political contributions or attend fund- raising or other political events, no member or employee shall publicly support any candidate for any municipal office subject to the Commission's jurisdiction, including but not limited to volunteering as a campaign worker, giving a speech at a political ev"
